import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 90vh;
  align-items: center;
  justify-content: space-between;
`;

export const ErrorIcon = styled.img`
  width: 150px;
  height: 150px;
`;

export const Phrase = styled.div`
  font-family: "Roboto";
  font-size: 25px;
  color: #363535;
  text-align: center;
`;
